window.bookSummaryJSON = "<p>When the FBI prepares to head down to Brazil, Zach gets tapped to join them. Things aren’t going to plan though.</p> <p>Geists are being created and weaponized around Philly and even drawing the attention of the military.</p> <p>To solve it, Zach needs to go down to El Dorado and convince them that he’s not like the dragons that came before him and that they need to help him solve Aphrodite’s grand plan.</p> <p>Because the Archangel of love has no love for Earth and it’s clear her plan is going to cripple the world to save Heaven.</p>"; 
